        public bool exist()
        {
            sql = "SELECT codpostal FROM provincias WHERE codpostal = '" + this.codpostal + "'";
            if (con.query(sql).Tables[0].Rows.Count > 0)
            {
                return true;
            }


            return false;
        }

   

        public DataSet get_all()
        {
            DataSet ds = new DataSet();

            sql = "SELECT * FROM provincias WHERE codestado = 1";
            try
            {
                ds = con.query(sql);
            }
            catch (Exception ex)
            {
                Console.Write("ERROR al consultar provincias");
            }

            return ds;
        }

        public DataSet get(string reg_)
        {
            DataSet ds = new DataSet();

            sql = "SELECT * FROM provincias WHERE codestado = 1 AND reg = '" + reg_ + "'";
            try
            {
                ds = con.query(sql);
            }
            catch (Exception ex)
            {
                Console.Write("ERROR al consultar provincias");
            }

            return ds;
        }


        public DataSet get_all_busqueda(string coincidencia)
        {
            DataSet ds = new DataSet();

            sql = "SELECT * FROM provincias WHERE codestado = 1 AND " +
                " ( TRIM(provincia) LIKE  '%" + coincidencia.Trim() + "%' OR TRIM(codpostal) LIKE  '" + coincidencia.Trim() + "%' OR TRIM(ciudad) LIKE  '%" + coincidencia.Trim() + "%' )";

            
            try
            {
                ds = con.query(sql);
            }
            catch (Exception ex)
            {
                Console.Write("ERROR al consultar provincias");
            }

            return ds;
        }

  

        public bool save()
        {
            try
            {
                if (this.exist())
                {
                    sql = "UPDATE provincias SET " +
                        "provincia = '" + this.provincia + "'," +
                        "ciudad = '" + this.ciudad + "'," +
                        "codpostal = '" + this.codpostal + "'," +
                        "ultmod = '" + this.ultmod + "'," +
                        "user_edit = '" + this.user_edit + "'," +
                        "codestado = '1'" +
                        " WHERE reg = '" + this.reg + "'";
                }
                else
                {
                    sql = "INSERT INTO provincias (" + this.columns + ") VALUES(" +
                        "'" + this.codpostal + "'," +
                        "'" + this.provincia + "'," +
                        "'" + this.ciudad + "'," +
                        "'" + this.ultmod + "'," +
                        "'" + this.user_edit + "'," +
                        "'" + this.codestado + "'" +
                        ") ";
                }

                con.query(sql);
                return true;

            }
            catch (Exception ex)
            {
                return false;
            }

        }

        public string concat_sql()
        {
            try
            {
                sql = "(" +
                    "'" + this.codpostal + "'," +
                    "'" + this.provincia + "'," +
                    "'" + this.ciudad + "'," +
                    "'" + this.ultmod + "'," +
                    "'" + this.user_edit + "'," +
                    "'" + this.codestado + "'" +
                    ") ";

                return sql;

            }
            catch (Exception ex)
            {
                return sql;
            }

        }

